import React from 'react';
import { GET_USER } from './api';

function App() {
  const [dados, setDados] = React.useState(null);

  React.useEffect(() => {
    const { url, options } = GET_USER();
    fetch(url, options)
      .then((response) => response.json())
      .then((json) => setDados(json));
  }, [dados]);

  if (dados === null) return null;
  return (
    <div>
      {dados.map((e) => (
        <div>
          <p>{e.id}</p>
          <p>{e.nome}</p>
          <p>{e.email}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
